import Grid from '@material-ui/core/Grid';
import React from 'react';
import DashboardV from './src/Dashboard';
import HeaderV from './src/Header';
import LineChartV from './src/LineChart';
import RadarChartV from './src/RadarChart';

function App() {
  return (
    <div  style={{backgroundColor:'#eee'}}>

      <HeaderV/>

      <Grid container >
        <Grid>
        <Grid item xs={12} sm={9} md={3} >
        <DashboardV/>
        </Grid>
        </Grid>

        <Grid>
        <Grid container>
        <Grid item xs={6} sm={9} md={5}  style={{width:'100%',backgroundColor:'white',margin:'5px'}}>
      <LineChartV/>
      </Grid>

      <Grid item xs={6} sm={9} md={5}  style={{width:'100%',backgroundColor:'white',margin:'5px'}}>
       <RadarChartV/>
     </Grid>
     </Grid>

     <Grid container>

     <Grid item xs={6} sm={9} md={5}  style={{width:'100%',backgroundColor:'white',margin:'5px'}}>
      <LineChartV/>
      </Grid>


      <Grid item xs={6} sm={9} md={5}  style={{width:'100%',backgroundColor:'white',margin:'5px'}}>
      <LineChartV/>
      </Grid>
      </Grid>

      </Grid>


          </Grid>

</div>


  );
}

export default App;
